import { GET_CONTACTS } from "./types";

export const getContacts = () => {
  return {
    type: GET_CONTACTS
  };
};

export const deleteContacts = id => {
  return {
    type: DELETE_CONTACTS
  };
};

export const addContacts = () => {
  return {
    type: ADD_CONTACTS
  };
};
